class CreateWish extends Component {
  constructor(props) {
    super(props);
    this.state = {
      wishTitle: ''
    }
  }
  handleChange = (e) => {
    this.setState({
      wishTitle: e.target.value
    })
  }

  handleSubmit = (e) => {
    e.preventDefault();
    console.log("submit")
  }

  render() {
    return (
      <div>
        <form onSubmit={handleSubmit}>
          <input onChange={this.handleChange} placeholder="Enter Wishlist Title" />
        </form>
      </div>
    )
  }
}

